 * @param quantityPerCategory the quantity of tokens per category to be minted
 * @param tokenURIs the token URI per category
 */
struct SongData {
    bool isStreaming;
    uint256[5] quantityPerCategory;
    string[6] tokenURIs;
}

/**
 * @dev the data of royalties
 * @param royaltyPercent the royalty percent with two decimals
 * @param royaltyRecipient the royalty recipient
 * @param proofOfAuthenticity the proof of authenticity
 */
struct RoyaltyData {
    uint16 royaltyPercent;
    address royaltyRecipient;
    string proofOfAuthenticity;
}
